const out = [];

for (const item of $input.all()) {
  const id = item.json?.defaultDatasetId;
  if (id) {
    out.push({ json: { defaultDatasetId: id } });
  }
}

return out;

value.address/DirecciónCompleta:
={{
(() => {
  let a;
  try {
    a = typeof $json.address === 'string' ? JSON.parse($json.address) : $json.address || {};
  } catch (e) {
    a = {};
  }
  return [
    a.streetAddress,
    a.city,
    a.state,
    a.zipcode
  ]
  .filter(v => v && v !== 'null')
  .join('\n');
})()
}}

value.nearbyHomes:
={{
($json.nearbyHomes || [])
  .map(h => 
    'https://www.zillow.com' + 
    (h.hdpUrl || '').replace(/\/$/, '') // agrega dominio y elimina slash final
  )
  .filter(v => v && v !== 'https://www.zillow.com')
  .join('\n') // salto de línea entre URLs
}}

value.collections.modules.propertyDetails[]:
={{
(() => {
  const details = $json.collections?.modules?.[0]?.propertyDetails?.[0];
  if (!details) return 'Sin datos disponibles';

  const url = details.hdpUrl 
    ? `www.zillow.com/${details.hdpUrl.replace(/^\/|\/$/g, '')}` 
    : 'No URL';

  const address = details.address 
    ? `${details.address.streetAddress || ''}, ${details.address.city || ''}, ${details.address.state || ''}`.trim()
    : 'No address';

  return [
    `💰 Precio: ${details.price || 'N/A'}`,
    `📏 Tamaño del lote: ${details.lotSize || 'N/A'}`,
    `🏡 Área del terreno: ${details.lotAreaValue || 'N/A'} ${details.lotAreaUnits || ''}`,
    `📍 Dirección: ${address}`,
    `🧭 Coordenadas: ${details.latitude || 'N/A'}, ${details.longitude || 'N/A'}`,
    `📄 Estado: ${details.homeStatus || 'N/A'}`,
    `🏠 Tipo: ${details.homeType || 'N/A'}`,
    `🔗 URL: ${url}`
  ].join('\n');
})()
}}

